import React from "react";
import s from "./profilePage.module.css";
import { UilEdit, UilUser } from "@iconscout/react-unicons";

const ProfilePage = () => {
  return (
    <div className={s.profilePageContainer}>
      <div className={s.profilePageHeaderContainer}>
        <img src="" alt="" />
        <div className={s.profilePageHeaderProfileInfo}>
          <div className={s.profilePageHeaderProfileInfoLeftContainer}>
            <UilUser />
            <div>
              <h2>UserName</h2>
              <p>followers: nnn</p>
            </div>
          </div>
          <div className={s.profilePageHeaderProfileInfoRightContainer}>
            <button className={s.editButton}><UilEdit />Edit Profile</button>
            <button className={s.moreActions}></button>
          </div>
        </div>
        <div className={s.profilePageHeaderNavigation}></div>
      </div>
    </div>
  );
};

export default ProfilePage;
